import React, { useEffect } from 'react';
import { useDispatch } from 'react-redux';
import { getProductsBySlug } from '../../actions';
import Layout from '../../components/Layout';
import './style.css';


/** 
 * @auteur
 * @fonction ProductListPage
 **/

const ProductListPage = (props) => {

    const dispatch = useDispatch();

    useEffect(() => {
        const { match } = props;
        if (match) {
            dispatch(getProductsBySlug(match.params.slug));
        }

    }, []);

    return (
        <Layout>
           <div className='card'>
            <div className='cardHeader'>
                <div>Samsung mobile moins 60k</div>
                <button>voir tous</button>
            </div>
            <div>
                <div className='productContainer'>
                    <div className='productImgContainer'>
                        <img 
                        src='http://localhost:2000/public/b2S2myOYnh-f2.webp' alt='' />
                    </div>
                    <div className='productInfo'>
                    <div style={{margin: '5px 0'}}>Samsung 4gb telephone</div>
                    <div>
                        <span>4.3</span>&nbsp;
                        <span>3353</span>
                    </div>
                    <div className='productPrice'>150000</div>
                    </div>
                </div>
            </div>

           </div>
        </Layout>
    )
}


export default ProductListPage;
